package uz.gita.contact_app_with_firebase.diimport dagger.Bindsimport dagger.Moduleimport dagger.hilt.InstallInimport dagger.hilt.components.SingletonComponentimport uz.gita.contact_app_with_firebase.navigation.AppNavigatorimport uz.gita.contact_app_with_firebase.navigation.AppNavigatorDispatcherimport uz.gita.contact_app_with_firebase.navigation.AppNavigatorHandlerimport javax.inject.Singleton@Module@InstallIn(SingletonComponent::class)interface NavigationModule {    @[Binds Singleton]    fun bindsAppNavigator(impl: AppNavigatorDispatcher): AppNavigator    @[Binds Singleton]    fun bindsAppNavigatorHandler(impl: AppNavigatorDispatcher): AppNavigatorHandler}